import React, { Fragment } from 'react';
import ContactKeeper from '../layout/ContactKeeper.png'
import GithubSearcher from '../layout/GithubSearcher.png'
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Website from '../layout/Portfolio.png'
const Portfolio = () => {
    return (
        <div className= "bg-darkblue py-2-bottom">
            <div className ="grid-2">
                <div className="portfolio">
                    <img        
                        src={ContactKeeper}
                        style={{width: '100%', height: '100%'}}
                        alt ="ContactKeeper"
                    />
                    <div className="subtitle">Contact Keeper</div>
                </div>

                <div className="portfolio">
                    <img
                        src={GithubSearcher}
                        style={{width: '100%', height: '100%'}}
                        alt = 'Github Searcher'
                    />
                <div className="subtitle">Github Searcher</div>
                </div>

                <div className="portfolio">
                    <img
                        src={Website}
                        style={{width: '100%', height: '100%'}}
                        alt = 'Portfolio'
                    />
                <div className="subtitle">Portfolio Website</div>
                </div>
            </div>
        </div>
    )
}

export default Portfolio
